import React from 'react';
import { PieChart } from 'react-minimal-pie-chart';

class App extends React.Component {

  render() {
    return (
      <div>
        <h1>Room Capacity Checkr</h1>
        <h2>Room number: </h2>
        <PieChart 
          data={[
            { title: 'occupied spots', value: 10, color: '#fa0000'}, //occupied
            { title: 'free spots', value: 15, color: '#3efa00' }, //free

          ]}
        />;
      </div>
    );
  }
}

export default App;
